import react from "react";
function ExpenseDate(props) {
    const month = '12' //props.date.toLocaleString('en-US', {month: 'long'});
    const day = '10' //props.date.toLocaleString('en-US', {day: '2-digit'});
    const year = props.date.prototype.getFullYear();

    return (
        <div>
            <div>{day}</div>
            <div>{month}</div>
            <div>{year}</div>
        </div>
    );
}

export default ExpenseDate;
